function checkIfClicked(event) {
        event.preventDefault();
        alert("button clicked!");
}

/* */
function modifyGradeButtons() {
        function addCustomEventListeners(gradebuttons) {
                gradebuttons.forEach((button, index) => {
                        // alert(button.outerHTML);
                        button.addEventListener(
                                "click",
                                (e) => {
                                        e.preventDefault();
                                        popup(e, index + 1);
                                        addProgress();
                                        injectNextPage(e);
                                },
                                { once: true }
                        );
                }); // callbacks don't seem to work as event handlers on ios??
        } // can't seem to attach shit
        // alert("finding grade buttons...");
        let gradebuttons = document.querySelectorAll("input[id|='grade']");
        if (gradebuttons == null) {
                // alert("no grade buttons found");
                return;
        } else {
                // alert(gradebuttons.length)
                addCustomEventListeners(gradebuttons);
        }
}

/* */
function modifyShowButton() {
        let showbutton = document.getElementById("show-answer");
        if (showbutton == null) {
                modifyGradeButtons();
                return;
        }
        // alert(showbutton.outerHTML);
        showbutton.addEventListener("click", async (e) => {
                e.preventDefault();
                // alert("event prevented");
                let formData = new URLSearchParams(
                        new FormData(e.target.parentNode)
                );
                // alert(formData);
                let page = await fetch("https://jpdb.io/review?" + formData);
                if (page.ok) {
                        let result = await page.text();
                        result = result.slice(15);
                        document.documentElement.innerHTML = result;
                        stylePopups();
                        document.body.insertAdjacentHTML(
                                "afterbegin",
                                progress()
                        );
                        modifyGradeButtons();
                } else {
                        throw new Error("Something went wrong.");
                }
        });
}

/* */
async function cardsPerSession() {
        // alert("fetching cps")
        let settings = await fetch("https://jpdb.io/settings");
        if (settings.ok) {
                settings = new DOMParser().parseFromString(
                        await settings.text(),
                        "text/html"
                );
                let count = settings.getElementById(
                        "cards-per-review-session"
                ).value;
                count = parseInt(count);
                // alert(count + " (" + typeof(count) + ")");
                return count;
        } else {
                // alert("go to sleep already");
        }
        return 0;
}

/* PROGRESS BAR */
function progress() {
        // alert("inserting progress bar...")
        // alert(`Count: ${count}, maxCount: ${maxCount}, %: ${Math.round((count / maxCount) * 100)}%`)
        document.head.innerHTML += `
<style>
#progress {
        height: 0.5rem; 
        background-color: salmon; 
        width: ${Math.round((count / maxCount) * 100)}%;
        animation: add-progress 0.5s;
        animation-fill-mode: forwards;
        animation-play-state: paused;
}
.running {
}
@keyframes add-progress {
        to {
                width: ${Math.round(((count + 1) / maxCount) * 100)}%;
        }
}</style>`;
        return `<div id="progress"></div>`;
}

function addProgress() {
        let progressBar = document.getElementById("progress");
        progressBar.style.animationPlayState = "running";
        // alert("added progress");
}

