const messages = [
        null,
        "Next time!",
        "Almost!",
        "Tough one!",
        "Nice :)",
        "Wow!",
];
let correct;
{
        correct = new Audio(
                "data:audio/mpeg;base64,"
        );
} // set correct

let wrong;
{
        wrong = new Audio(
                "data:audio/mpeg;base64,"
        );
} // set wrong

function popup(e, i) {
        let msg = `
  <pop-up class="cardfinish${i}">
    ${messages[i]}
  </pop-up>`;
        document.body.innerHTML += msg;

        if (i <= 2) {
                wrong.play();
        } else {
                correct.play();
        } // play sound

        setTimeout(() => {
                e.target.click();
        }, 100); // fix this to adjust the timing as you want
}

async function fetch_finish_page(form) {
        let formData = new URLSearchParams(new FormData(form)); // https://stackoverflow.com/a/46642899
        let finishPage = await fetch("https://jpdb.io/review#a", {
                method: "POST",
                headers: {
                        "Content-Type": "application/x-www-form-urlencoded",
                },
                body: formData,
        });
        if (finishPage.ok) {
                let result = await finishPage.text();
                result = result.slice(15);
                return result;
        } else {
                throw new Error("Something went wrong.");
        }
}

async function injectNextPage(event) {
        count += 1;
        let html = await fetch_finish_page(event.target.parentNode);
        document.documentElement.innerHTML = html;
        document.body.insertAdjacentHTML("afterbegin", progress());
        // alert("Cards done: " + count);
        modifyShowButton();
        if (count >= maxCount) {
                insertFinishAudio();
                insertConfetti();
        }
}

